import React from 'react'


const Home = () => {
  return (
    <>
        <h1>Home</h1>
        <Link to={'/register'}>New to website? Create Account</Link>
        <Link to={'/login'}>Already have account? Login</Link>
    </>
  )
}

export default Home;
